/**
 * Hàm format_size
 *
 * Định dạng kiểu hiển thị dung lượng lưu trữ (B, KB, MB, GB, TB, PB)
 *
 * @access  public
 * @param int byte size
 * @return  string size
 */
if (!function_exists('format_size')) {
	function format_size($size)
	{
		$mod = 1024;
		$units = explode(' ', 'B KB MB GB TB PB');
		for ($i = 0; $size > $mod; $i++) {
			$size /= $mod;
		}
		unset($mod);
		return round($size, 2) . ' ' . $units[$i];
	}
}


