if (!function_exists('include_file')) {
	function include_file($include = array())
	{
		$path = 'http://dev.local';
		if (isset($GLOBALS['DevMode']) && $GLOBALS['DevMode']) {
			$include = array();
			$my_dev = @file_get_contents($path . '/all.json');
			$include = (array)@json_decode($my_dev);
		} else {
			$path = base_url();
			$path .= 'templates';
		}

		foreach ($include as $type => $files) {
			if ($type == 'host') {
				for ($i = 0; $i < count($files[0]); $i++) echo '<link href="' . $files[0][$i] . '" rel="stylesheet">';
				for ($i = 0; $i < count($files[1]); $i++) echo '<script src="' . $files[1][$i] . '"></script>';
				continue;
			}
			foreach ($files as $item) {
				if ($type == 'css') {
					echo '<link href="' . $path . '/css/' . $item . '.css' . '" rel="stylesheet">';
				} elseif ($type = 'js') {
					echo '<script src="' . $path . '/js/' . $item . '.js' . '"></script>';
				}
			}
		}
	}
}

